import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const ViewBunks = () => {
  const navigate = useNavigate();
  const [bunks, setBunks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchBunks();
  }, []);

  const fetchBunks = async () => {
    try {
      // Fixed endpoint to match the Express route
      const response = await axios.get('/api/bunks/', {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
      });
      setBunks(response.data);
    } catch (err) {
      setError('Error fetching bunks: ' + (err.response?.data?.message || err.message));
    } finally {
      setLoading(false);
    }
  };

  const handleEdit = (bunkId) => {
    navigate(`/admin/edit-bunk/${bunkId}`);
  };

  const handleDelete = async (bunkId) => {
    if (!window.confirm('Are you sure you want to delete this bunk?')) {
      return;
    }

    try {
      // Fixed endpoint to match the Express route
      await axios.delete(`/api/bunks/${bunkId}`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
      });
      setBunks((prevBunks) => prevBunks.filter((bunk) => bunk._id !== bunkId));
    } catch (err) {
      setError('Error deleting bunk: ' + (err.response?.data?.message || err.message));
    }
  };

  if (loading) {
    return <div className="flex justify-center items-center h-screen">Loading EV Bunks...</div>;
  }

  return (
    <div className="container mx-auto p-6">
      <div className="bg-white shadow-md rounded-lg p-6">
        <h1 className="text-2xl font-bold mb-6">All EV Bunks</h1>
        
        {/* Back Button */}
        <div className="mb-4">
          <button
            onClick={() => navigate('/admin/dashboard')}
            className="py-2 px-4 bg-gray-700 text-white rounded hover:bg-gray-800"
          >
            ‚Üê Back to Dashboard
          </button>
        </div>

        {/* Error Message */}
        {error && <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">{error}</div>}

        {/* Bunks List */}
        <div className="space-y-4">
          {bunks.map((bunk) => (
            <div key={bunk._id} className="border border-gray-300 rounded-lg p-4 bg-gray-50">
              <h3 className="text-lg font-semibold mb-2">{bunk.name}</h3>
              <p className="text-sm text-gray-600 mb-1"><strong>Id:</strong> {bunk.bunkId}</p>
              <p className="text-sm text-gray-600 mb-1"><strong>Address:</strong> {bunk.address}</p>
              <p className="text-sm text-gray-600 mb-1"><strong>Phone:</strong> {bunk.phone}</p>
              <p className="text-sm text-gray-600 mb-1"><strong>Slots:</strong> {bunk.slotsAvailable}</p>
              <p className="text-sm text-gray-600 mb-1"><strong>Hours:</strong> {bunk.operatingHours || 'N/A'}</p>
              <p className="text-sm text-gray-600 mb-1"><strong>Connectors:</strong> {bunk.connectorTypes || 'N/A'}</p>
              <p className="text-sm text-gray-600 mb-3"><strong>Location:</strong> {bunk.latitude}, {bunk.longitude}</p>
              
              {/* Action Buttons */}
              <div className="flex space-x-2">
                <button
                  onClick={() => handleEdit(bunk._id)}
                  className="py-2 px-4 bg-green-500 text-white rounded hover:bg-green-600"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDelete(bunk._id)}
                  className="py-2 px-4 bg-red-500 text-white rounded hover:bg-red-600"
                >
                  Delete
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ViewBunks;
